import './App.css';
import Home from './components/Home';
import Chatbox from './components/Chatbox';
import AddItem from './components/AddItem';
import SearchMap from './components/SearchMap';
import { BrowserRouter as Router, Route, Routes} from "react-router-dom";
import CardDetails from './components/CardDetails';
import NavbarLayout from './components/NavbarLayout';
function App() {
  return (

    < >

    <Router>
      <Routes>
      <Route path="/" exact element={<NavbarLayout></NavbarLayout>} />
      </Routes>
      <Routes>
      <Route path="/chat" exact element={<NavbarLayout><Chatbox/></NavbarLayout> } />
      </Routes>
      <Routes>
      <Route path="/additem" exact element={<NavbarLayout><AddItem/></NavbarLayout>} />
      </Routes>
      <Routes>
      <Route path="/mapsearch" exact element={<NavbarLayout><SearchMap/></NavbarLayout> } />
      </Routes>
      <Routes>
      <Route path="/details" exact element={<NavbarLayout><CardDetails/></NavbarLayout> } />
      </Routes>
  </Router>
    </>
  );
}

export default App;
